import React, { Component } from 'react';

export default class List extends Component {

    constructor() {
        super();
        this.state = {
            a:  {
                name: 'Sam',
                email: 'somewhere@gmail.com'
            }
        }
    }

    _renderItems() {
        return this.state.a.map(el => <p>{el}</p>)
    }

    render() {
        return (
            <div>
                {this._renderItems()}
            </div>
        )
    }
}
